		<div class="job_description">
			<p>JLL is hiring a Senior Conveyor Maintenance Technician to Support Amazon&#8217;s State-of-the-art distribution center in Sussex, WI!</p>
<p> Are you looking for your next challenge, great pay, industry-leading benefits, and outstanding career progression? Then get ready to join the JLL team, supporting Amazon&#8217;s distribution centers! We provide facility management, automation, and maintenance services in distribution centers across the U.S and Canada.</p>
<p> Our teams of JLL technicians, facilities managers, and administrators work together to keep fulfillment center machinery running smoothly while upholding a safe environment where all employees can thrive. As we continue to grow, our JLL facilities teams need capable people ready to keep buildings and equipment in safe working order. We have over 1,000 technicians and are planning to add 500 more skilled workers this year. If you&#8217;re looking for a career that will provide a fast-paced work environment, ability to grow your career and the chance to learn from the best in the industry, then we&#8217;re looking for people like you!</p>
<p> The Senior Conveyor Maintenance Technician (MHE II) possesses strong technical skills and has performed maintenance in industrial environments. They will support Lead Operating Engineers and Technicians to troubleshoot problems and manage outside contractors. The MHE II will help to develop plans on how to accomplish department and distribution goals.</p>
<p> ESSENTIAL FUNCTIONS</p>
<p> * Maintain and troubleshoot conveyor systems and related electrical and mechanical equipment</p>
<p> * Maintain a safety-first culture by promoting and driving safe work practices timely training, best practices as well as delivering rewards and recognitions to promote safe behavior.</p>
<p> * Implement Preventive Maintenance programs</p>
<p> * Ability to maintain, and troubleshoot basic power distribution systems, branch circuits, lighting systems, transformers, and wiring methods and materials</p>
<p> * Ability to maintain and troubleshoot basic relay logic, ladder diagrams, control components&#8211; photo eyes, motor starters, relays, limit switches, proximity sensors, timers, solenoids, Servo drives, frequency inverters, linear drives, tachs, and encoders</p>
<p> * Basic knowledge of PLC programs, ability to troubleshoot ladder logic (read use for troubleshooting), components (CPU back plains, I/O boards, counters, modules, and devices) and communications modules (Ethernet)</p>
<p> * Mentor Level 1 technicians by motivating, providing guidance and directions to help them achieve their goals</p>
<p> * Develop and maintain a good working relationship across all levels in the organization</p>
<p> * Ability to provide enriched feedback to enhance individual performance</p>
<p> PHYSICAL DEMANDS</p>
<p> * Lift and move items up to 49 pounds each</p>
<p> * Regular bending, lifting, stretching and reaching both below the waist and above the head</p>
<p> * Occasionally push and pull wheeled dollies loaded with products up to 100 pounds</p>
<p> * Engage in full manual dexterity in both hands and wrists</p>
<p> * Walking in the FC and around the area with great frequency; facilities are over a quarter-mile in length</p>
<p> * Ability to climb ladders and gangways safely and without limitation</p>
<p> * Ability to work in construction /distribution environments that may be noisy, unlit, unheated, not air-conditioned</p>
<p> * Must be able to stand/walk for up to 10-12 hours</p>
<p> * Able to access all areas of the building (ascending and descending ladders, stairs, etc.)</p>
<p> OPERATION SUPPORT AND CUSTOMER SERVICE</p>
<p> * Promoting and conduct good housekeeping practices</p>
<p> * Dedicated to supporting production by working in a safe, customer-focused manner</p>
<p> * Must be highly self-motivated and customer-centric</p>
<p> EDUCATION</p>
<p> * High school diploma or equivalent</p>
<p> PREFERRED EXPERIENCE</p>
<p> * Degree from a vocational school or college with a focus on the Mechanical or Electrical field</p>
<p> * 4 years apprenticeship or equivalent experience in the Mechanical or Electrical field</p>
<p> * Able to manage, lead, and influence others on the team</p>
<p> * Demonstrated ability to multi-task and prioritize many different projects and workload</p>
<p> * Leadership experience/aptitude, ability to mentor and develop training plans for other service technicians</p>
<p> PROFICIENCIES</p>
<p> * Automated conveyors systems and controls</p>
<p> * Electrical and electronic principles</p>
<p> * Blueprint and electrical schematic reading</p>
<p> * Knowledge of CMMS programs</p>
<p> * Preventative maintenance procedures</p>
<p> * Industrial electrical</p>
<p> * Industrial controls</p>
<p> * Industrial Electronics</p>
<p> * PLC programs</p>
<p> * Industrial PC literacy</p>
<p> * Knowledge of N.E.C.</p>
<p> KNOWLEDGE, SKILLS, AND ABILITIES</p>
<p> * Ability to work independently</p>
<p> * Ability to communicate effectively, (written and verbally) with peers, management, contractors, and vendors</p>
<p> * Must be highly self-motivated and customer-centri</p>
<p> JLL Privacy Notice</p>
<p> Jones Lang LaSalle (JLL), together with its subsidiaries and affiliates, is a leading global provider of real estate and investment management services. We take our responsibility to protect the personal information provided to us seriously. Generally the personal information we collect from you are for the purposes of processing in connection with JLL&#8217;s recruitment process. We endeavour to keep your personal information secure with appropriate level of security and keep for as long as we need it for legitimate business or legal reasons. We will then delete it safely and securely.</p>
<p> For more information about how JLL processes your personal data, please view our Candidate Privacy Statement.</p>
<p> For additional details please see our career site pages for each country.</p>
<p> For employees in the United States, please see a fully copy of our Equal Employment Opportunity and Affirmative Action policy here.</p>
<p> Jones Lang LaSalle (&#8220;JLL&#8221;) is an Equal Opportunity Employer and is committed to working with and providing reasonable accommodations to individuals with disabilities. If you need a reasonable accommodation because of a disability for any part of the employment process ‚Äì including the online application and/or overall selection process ‚Äì you may email us at Accommodation.Reques@am.jl..com. This email is only to request an accommodation. Please direct any other general recruiting inquiries to our Contact Us page &gt; I want to work for JLL.</p>
<p style='font-weight: bold'>AC2019</p>
